        ajax: function(TYPE, URL, DTYPE, DATA, CB_OK, CB_ERR, AjaxSync) {
            var _this = this;
            var _result = false;
            if(TYPE=='GET'){  
                if(URL.indexOf('?')!=-1){
                    URL=URL+"&"+random_;
                }else{
                    URL=URL+"?"+random_;
                }
                
            } else if(URL!='/login/auth'){//先登录进去cookie里才有值，所以登录uri不操作
                if ( URL!='/login/unauth'
                    && URL!='/mease/ifstatistic/set' && URL!='/ipsec/showsa/set' 
                    && URL!='/session/statistics/enable/set'
                    && URL!='/session/search/set')
                {
                    if($.cookie('pf_').split(',')[6]==1){
                        fn.tdialog({
                            type: "info",
                            'content': $.i18n.prop("wglang--105940"),//'访客模式不允许下发配置',
                        });  
                        return false;  
                    }else if(URL != '/configfile/save_cfg' ){
                        $('#saveConfig span').attr('class','saveWait_');//下发配置时保存按钮变红
                    }
                                
                }
            } else {
                /*解决登录soc后同pc登录防火墙失败的问题*/
                var date=new Date();    
                date.setTime(date.getTime()-10000);
                document.cookie='UUID'+"=null; expire="+date.toGMTString()+"; path=/webui";
                document.cookie='uuid'+"=null; expire="+date.toGMTString()+"; path=/";
            }
            if (!URL || URL.charAt(0) != "/" || !CB_OK) {
                return false;
            }
            if (DTYPE == "text") {
                if(window.postEncrypt){
                    if (typeof DATA == "object") {
                        //DATA = encodeURI(jQuery.toJSON(DATA || {})) ; /* encodeURI utf-8*/
                        DATA = _this.UrlEncode(jQuery.toJSON(DATA || {}).replace(/\\\\/g, "\\")); /* UrlEncode ansi*/
                    } else {
                        DATA = _this.UrlEncode(DATA.replace(/\\\\/g, "\\")); /* UrlEncode ansi*/
                    }
                }else{//post加密
                    var tmpd = "";
                    if(URL!='/login/auth' && URL!='/login/unauth'){
                        if (typeof DATA == "object") {
                            tmpd = {"www_post_uri":DATA,"ur":$.cookie('ck_username')};
                        } else {
                            tmpd = {"www_post_uri":jQuery.evalJSON(DATA),"ur":$.cookie('ck_username')}; 
                        }
                        var ptmp = _this.UrlEncode(jQuery.toJSON(tmpd|| {}).replace(/\\\\/g, "\\"));                  
                        DATA = _this.UrlEncode(jQuery.toJSON({'cc':_this.randomString(77),'pr':_this.Base64Ex(ptmp),'se':_this.randomString(233)})); 
                    }else{
                        if (typeof DATA == "object") {
                            tmpd = jQuery.toJSON(DATA || {}).replace(/\\\\/g, "\\");
                        } else {
                            tmpd = DATA.replace(/\\\\/g, "\\"); 
                        }                    
                        DATA = _this.UrlEncode(tmpd);
                    }
                }
            } else {
                DATA = DATA || {};
            }

            jQuery.ajax({
                type: TYPE,
                url: ((URL.match("^/webApp") != null) || (URL.match("^/json") != null) || (URL.match("^/testJson") != null)) ? URL : (uribase + URL), //uribase + URL ,              
                data: DATA,
                async: (AjaxSync == undefined) ? true : AjaxSync,
                dataType: DTYPE,
                cache:false,
                headers: {
                    "Content-Type": "text/json"
                },
                success: function(response, textStatus, XHR) {
                    if (DTYPE == "html") {
                        _result = true;
                        CB_OK(response);
                        $.i18nDo();
                        return _result;
                    }
                    if (DTYPE == "text") {
                        var str = decodeURI(response);
                        response = jQuery.evalJSON(str.replace(/\n/g, "<br>").replace(/\r/g, ""));
                    }
                    _this.trace("success : " + URL + ", result " + jQuery.toJSON(response));
                    if (response.result == SUCCESS) {
                        _result = true;
                        CB_OK($.UDECODE(response));
                        //$.urlDcd(); // 对返回的数据做url解码,暂未使用
                        return _result;
                    } else if (response.result == ERR_TOKENEXP) {                                               
                        //超时处理
                        function promptCB() {
                            _this.access_token = "";
                            _this.cookie.del("access_token");
                            location.href = window.location.protocol + "//" + window.location.host;
                        }
                        if (codeMsg[response.result]) {
                            fn.tdialog({
                                url:URL,
                                type: "info",
                                'content': codeMsg[response.result],
                                promptCallback: promptCB
                            });
                        }

                    } else {
                        if (response.errmsg) {
                            response.errmsg = _this.removeDuplicate(_this.Base64Decode($.UDECODE($.HDECODE(response)).errmsg));
                            response.errmsg = _this.strAnsi2Unicode(response.errmsg);
                            fn.tdialog({
                                url:URL,
                                type: "info",
                                'content': response.errmsg
                            });
                        }
                        CB_ERR(response.errmsg);
                    }
                    //CB_ERR(response.result + ":" + codeMsg[response.result] +"<br>"+response.errmsg,XHR) ;
                },
                error: function(XHR, textStatus, errorThrown) {
                    _this.trace("error" + URL);
                    CB_ERR(errorThrown, XHR);
                    if (XHR.errmsg) {
                        fn.tdialog({
                            url:URL,
                            type: "info",
                            'content': XHR.errmsg
                        });
                    }
                }
            });
            return _result;
        },

        login: function(username, password, CB_OK) {
            var _this = this;
            var _result = false;
            // check arg 
            if (username && password) {
                this.ajax("GET", "/login/auth", "json", {
                        username: username,
                        password: password
                    },
                    function(res) {
                        // update env 
                        _this.access_token = res.data.access_token;
                        _this.trace("Login ok, token = " + _this.access_token);

                        // update cookie 
                        _this.cookie.set("access_token", _this.access_token);
                        _result = true;
                        if (CB_OK)
                            CB_OK();
                    },
                    function(XHR, errmsg) {
                        _this.trace("login failed (access).");
                    });
            }

            return _result;
        },
