        Utf16To8: function(str) {
            var out, i, len, c;
            out = "";
            len = str.length;
            for (i = 0; i < len; i++) {
                c = str.charCodeAt(i);
                if ((c >= 0x0001) && (c <= 0x007F)) {
                    out += str.charAt(i);
                } else if (c > 0x07FF) {
                    out += String.fromCharCode(0xE0 | ((c >> 12) & 0x0F));
                    out += String.fromCharCode(0x80 | ((c >> 6) & 0x3F));
                    out += String.fromCharCode(0x80 | ((c >> 0) & 0x3F));
                } else {
                    out += String.fromCharCode(0xC0 | ((c >> 6) & 0x1F));
                    out += String.fromCharCode(0x80 | ((c >> 0) & 0x3F));
                }
            }
            return out;
        },
        Utf8To16: function(str) {
            var out, i, len, c;
            var char2, char3;
            out = "";
            len = str.length;
            i = 0;
            while (i < len) {
                c = str.charCodeAt(i++);
                switch (c >> 4) {
                    case 0:
                    case 1:
                    case 2:
                    case 3:
                    case 4:
                    case 5:
                    case 6:
                    case 7:
                        // 0xxxxxxx 
                        out += str.charAt(i - 1);
                        break;
                    case 12:
                    case 13:
                        // 110x xxxx 10xx xxxx 
                        char2 = str.charCodeAt(i++);
                        out += String.fromCharCode(((c & 0x1F) << 6) | (char2 & 0x3F));
                        break;
                    case 14:
                        // 1110 xxxx10xx xxxx10xx xxxx 
                        char2 = str.charCodeAt(i++);
                        char3 = str.charCodeAt(i++);
                        out += String.fromCharCode(((c & 0x0F) << 12) |
                            ((char2 & 0x3F) << 6) |
                            ((char3 & 0x3F) << 0));
                        break;
                }
            }
            return out;
        },
        //将Unicode编码的字符串，转换成Ansi编码的字符串
        strUnicode2Ansi: function (asContents) {
            var len1 = asContents.length;
            var temp = "";
            for (var i = 0; i < len1; i++) {
                var varasc = asContents.charCodeAt(i);
                if (varasc < 0)
                    varasc += 65536;
                if (varasc > 127)
                    varasc = this.UnicodeToAnsi(varasc);
                if (varasc > 255) {
                    var varlow = varasc & 65280;
                    varlow = varlow >> 8;
                    var varhigh = varasc & 255;
                    temp += String.fromCharCode(varlow) + String.fromCharCode(varhigh);
                }
                else {
                    temp += String.fromCharCode(varasc);
                }
            }
            return temp;
        },
        //将Ansi编码的字符串，转换成Unicode编码的字符串
        strAnsi2Unicode: function (asContents) {
            var len1 = asContents.length;
            var temp = "";
            var chrcode;
            for (var i = 0; i < len1; i++) {
                var varasc = asContents.charCodeAt(i);
                if (varasc > 127) {
                    chrcode = this.AnsiToUnicode((varasc << 8) + asContents.charCodeAt(++i));
                }
                else {
                    chrcode = varasc;
                }
                temp += String.fromCharCode(chrcode);
            }
            return temp;
        },
