        removeDuplicate: function(res) {
            //合并重复错误提示信息
            var resObj = {},
                resstr = "";
            $.each(res.replace(/\r/g,'').split('\n'), function(k, v) {
                if (v != "") { //过滤掉空行
                    if (resObj[v]) {
                        resObj[v]++;
                    } else {
                        resObj[v] = 1;
                    }
                }
            });
            $.each(resObj, function(k, v) {
                resstr += ((v > 1) ? k + "(" + v + ")" : k) + '<br>';
            });
            return resstr.replace(/<br>$/, '');
        }

